i; mso-bidi-font-family: Calibri;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri;\">We have been one of Deloitte and Touche&rsquo;s Best Managed Companies for the last 5 straight years.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri;\">We are also much better looking than our competition</span><span style=\"font-family: 'Segoe UI Emoji',sans-serif; mso-bidi-font-family: 'Segoe UI Emoji';\">ðŸ˜Š</span></p>\r\n<p class=\"MsoNormal\"><span style=\"mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri;\">Best Regards,</span></p>", carrier_id: 55, shipper_id: nil, date_stamp: "2019-01-03", user_id: 4, campaign_name: "", carrier_contact_id: 74, shipper_contact_id: nil, loads_per_week: "", outcome: "", reason: "", notes: "", reason_other: "", created_at: "2019-02-01 18:16:29", updated_at: "2019-02-01 18:16:29", load_numbers: nil},
  {id: 9, activity_type: "Initial Prospecting", engagement_type: "", annual_value: "", status: true, date_opened: "2019-02-01 20:22:37", date_closed: nil, other_notes: "<p class=\"MsoNormal\">Hi There,</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">Just following up as would like to talk more about establishing regular weekly service where you can count on having loads for your trucks every week, year round.</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">We can look at reserving anywhere from 1-5 or more trucks per week, specific loading days, etc.</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">I&rsquo;ll plan on calling Danny again on Monday.<span style=\"mso-spacerun: yes;\">&nbsp; </span>In the meantime, please feel free to contact me anytime.</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">Have a great weekend.</p>", carrier_id: 60, shipper_id: nil, date_stamp: "2019-01-02", user_id: 4, campaign_name: "", carrier_contact_id: 64, shipper_contact_id: nil, loads_per_week: "", outcome: "", reason: "", notes: "", reason_other: "", created_at: "2019-02-01 20:22:37", updated_at: "2019-02-01 20:22:37", load_numbers: nil}
