  {id: 4, carrier_id: 55, shipper_id: nil, activity_id: nil, user_id: 4, reminder_date: "2019-03-05", reminder_interval: 0, recurring: false, created_at: "2019-02-04 18:12:19", updated_at: "2019-02-04 18:12:19", last_reminded: nil, notes: "<p class=\"MsoNormal\"><span style=\"mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri;\">Hi Angelina,</span></p>\r\n<p class=\"MsoNormal\"><span style=\"mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri;\">Hope you had a great Superbowl weekend.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri;\">Following up on my email from below.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri;\">Would love to get regular weekly trucks set up out of AZ, CA, or TX &ndash; year round.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri;\">We pay in full upon delivery and have steady volumes on many lanes throughout the year.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri;\">You mentioned you were going to send me your truck list for this week, which would be a great start. </span></p>\r\n<p class=\"MsoNormal\"><span style=\"mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri;\">Please let me know we can move forward from here.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri;\">Best,</span></p>", reminder_type: "Follow-up"},
